            end else begin
              pe_busy <= 1'b0;
              need_new_vertex <= 1'b1;
            end
          end
        end
        pe_fsm_enumDef_PAUSE : begin
          if(io_state_switch_done) begin
            pe_busy <= 1'b0;
            rdy <= 1'b1;
            need_new_vertex <= 1'b1;
          end
        end
        default : begin
        end
      endcase
    end
  end

